import React, { Component } from 'react'

import dataTop from '../Data/dataTop'

class Carddeux extends Component {

  render () {

    return (
      <div className='Carddeux'>
         <h3>Top vente</h3>
        <br>
        </br>
        <img src={dataTop[0].image}></img>
        <p>Bougie marron<br/>Vanille</p>
      </div>
    )
  }
}

export default Carddeux
